import React from 'react'
import { Container } from 'react-bootstrap'
import SubTitle from '../Utility Components/SubTitle'

const Category = () => { 
  return (
    <Container>
      <SubTitle title={"Categories"} btnTitle={"more"}/>
    </Container>
  )
}

export default Category
